import './List.css'
import Checkbox from './Checkbox/Checkbox';
import Card from '../Card/Card';

const List = (props) => {

  const clickHandler = () =>{
    console.log("Clicked Checkbox");
}

  return (
    <Card className="container">
        <Checkbox onClick={clickHandler} ></Checkbox>
        <div>{props.rarity}</div>
        <div>{props.hexcode}</div>
    </Card>
    
  );
};

export default List;
